import logo from './logo.svg';
import './App.css';
import Ttext from './Ttext';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Ttext/>
        <img src={logo} className="App-logo" alt="logo" />

        <a
          className="App-link"
          //href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
